(28, 716, 0, 'CHUY Y CHAPARRO', 'ensenar a prender el calentador porque senora hablo y dijo que nadien la avia ensenado como prenderlo.', 'None', 'done', '2018-02-23', '2018-02-23 14:00:50', '2018-02-23 13:56:23'),
